CREATE TABLE IF NOT EXISTS `laronde`.`Facility_Tickets` (
  `FACILITY_TICKET_ID` INT NOT NULL,
  `FACILITY_ID` VARCHAR(6) NOT NULL,
  `TICKET_ID` INT NOT NULL,
  `TIMESTAMP` DATETIME NOT NULL,
  `idWeatherDate` DATE NOT NULL,
  PRIMARY KEY (`FACILITY_TICKET_ID`),
  INDEX `fk_Facility_Tickets_Facility1_idx` (`FACILITY_ID` ASC) VISIBLE,
  INDEX `fk_Facility_Tickets_Ticket1_idx` (`TICKET_ID` ASC) VISIBLE,
  INDEX `fk_Facility_Tickets_Weather1_idx` (`idWeatherDate` ASC) VISIBLE,
  CONSTRAINT `fk_Facility_Tickets_Facility1`
    FOREIGN KEY (`FACILITY_ID`)
    REFERENCES `laronde`.`Facility` (`FACILITY_ID`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `fk_Facility_Tickets_Ticket1`
    FOREIGN KEY (`TICKET_ID`)
    REFERENCES `laronde`.`Ticket` (`TICKET_ID`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `fk_Facility_Tickets_Weather1`
    FOREIGN KEY (`idWeatherDate`)
    REFERENCES `laronde`.`Weather` (`idWeatherDate`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;


-- -----------------------------------------------------
-- Table `laronde`.`Items`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `laronde`.`Items` (
  `ItemID` VARCHAR(7) NOT NULL,
  `item_desc` VARCHAR(45) NOT NULL,
  `price` FLOAT NOT NULL,
  `FACILITY_ID` VARCHAR(6) NOT NULL,
  PRIMARY KEY (`ItemID`),
  INDEX `fk_Items_Facility1_idx` (`FACILITY_ID` ASC) VISIBLE,
  CONSTRAINT `fk_Items_Facility1`
    FOREIGN KEY (`FACILITY_ID`)
    REFERENCES `laronde`.`Facility` (`FACILITY_ID`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;


-- -----------------------------------------------------
-- Table `laronde`.`Purchases`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `laronde`.`Purchases` (
  `PurchaseID` INT NOT NULL,
  `ItemID` VARCHAR(7) NOT NULL,
  `quantity` INT NOT NULL,
  `Date_transaction` DATETIME NOT NULL,
  `TICKET_ID` INT NOT NULL,
  PRIMARY KEY (`PurchaseID`, `TICKET_ID`, `ItemID`),
  INDEX `fk_Orders_Items1_idx` (`ItemID` ASC) VISIBLE,
  INDEX `fk_Purchases_Ticket1_idx` (`TICKET_ID` ASC) VISIBLE,
  CONSTRAINT `fk_Orders_Items1`
    FOREIGN KEY (`ItemID`)
    REFERENCES `laronde`.`Items` (`ItemID`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `fk_Purchases_Ticket1`
    FOREIGN KEY (`TICKET_ID`)
    REFERENCES `laronde`.`Ticket` (`TICKET_ID`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;


