/*------------------------------------------------------------*/
/* Query 1 - Corresponds to section 6.1 of the written report */
/*------------------------------------------------------------*/

/*Goale: See ride usage on days when there's precipitation vs no precipitation*/  
select "Ride usage during no precipitation" as "Precipitation vs No Precipitation", NumUsageNoPrecipitation "Ride usage", concat(round(NumUsageNoPrecipitation/(NumUsageNoPrecipitation+NumUsagePrecipitation)*100,2),"%") as "Percentage of total ride usage"
from 
	(SELECT count(*) as NumUsageNoPrecipitation
	FROM rides_tickets, weather
	where weather.idWeatherDate=rides_tickets.idWeatherDate and ((rainMM/10)+snowCM)=0) as UsageNoPrecipitation,

	(SELECT count(*) as NumUsagePrecipitation
	FROM rides_tickets, weather
	where weather.idWeatherDate=rides_tickets.idWeatherDate and ((rainMM/10)+snowCM)>0) as UsagePrecipitation

union

select "Ride usage during precipitation" as "Precipitation vs No Precipitation", NumUsagePrecipitation "Ride usage", concat(round(NumUsagePrecipitation/(NumUsageNoPrecipitation+NumUsagePrecipitation)*100,2),"%") as "Percentage of total ride usage"
from 
	(SELECT count(*) as NumUsageNoPrecipitation
	FROM rides_tickets, weather
	where weather.idWeatherDate=rides_tickets.idWeatherDate and ((rainMM/10)+snowCM)=0) as UsageNoPrecipitation,

	(SELECT count(*) as NumUsagePrecipitation
	FROM rides_tickets, weather
	where weather.idWeatherDate=rides_tickets.idWeatherDate and ((rainMM/10)+snowCM)>0) as UsagePrecipitation;


/*------------------------------------------------------------*/
/* Query 2 - Corresponds to section 6.2 of the written report */
/*------------------------------------------------------------*/

/*Goal: See sales at facilities on days when there's precipitation vs no precipitation*/  
select "Facility sales during no precipitation" as "Precipitation vs No Precipitation", concat("$",round(SalesNoPrecipitation,2)) "Facility Sales", concat(round(SalesNoPrecipitation/(SalesNoPrecipitation+SalesPrecipitation)*100,2),"%") as "Percentage of total Sales"
from 
	(SELECT sum(quantity*price) as SalesNoPrecipitation
	FROM facility_tickets, weather, items, purchases
	where weather.idWeatherDate=facility_tickets.idWeatherDate and date(purchases.date_transaction)=facility_tickets.idWeatherDate and items.ItemID=purchases.ItemID and ((rainMM/10)+snowCM)=0) as SalesNoPrecipitation,

	(SELECT sum(quantity*price) as SalesPrecipitation
	FROM facility_tickets, weather, items, purchases
	where weather.idWeatherDate=facility_tickets.idWeatherDate and date(purchases.date_transaction)=facility_tickets.idWeatherDate and items.ItemID=purchases.ItemID and ((rainMM/10)+snowCM)>0) as SalesPrecipitation

union

select "Facility sales during precipitation" as "Precipitation vs No Precipitation", concat("$", round(SalesPrecipitation,2)) "Facility Sales", concat(round(SalesPrecipitation/(SalesNoPrecipitation+SalesPrecipitation)*100,2),"%") as "Percentage of total Sales"
from 
	(SELECT sum(quantity*price) as SalesNoPrecipitation
	FROM facility_tickets, weather, items, purchases
	where weather.idWeatherDate=facility_tickets.idWeatherDate and date(purchases.date_transaction)=facility_tickets.idWeatherDate and items.ItemID=purchases.ItemID and ((rainMM/10)+snowCM)=0) as SalesNoPrecipitation,

	(SELECT sum(quantity*price) as SalesPrecipitation
	FROM facility_tickets, weather, items, purchases
	where weather.idWeatherDate=facility_tickets.idWeatherDate and date(purchases.date_transaction)=facility_tickets.idWeatherDate and items.ItemID=purchases.ItemID and ((rainMM/10)+snowCM)>0) as SalesPrecipitation;


/*------------------------------------------------------------*/
/* Query 3 - Corresponds to section 6.3 of the written report */
/*------------------------------------------------------------*/

/*Goal: See revenue made by year and month */
select year(Date_transaction) as Year, case
	when month(Date_transaction)=1 then "January"
    when month(Date_transaction)=2 then "February"
    when month(Date_transaction)=3 then "March"
    when month(Date_transaction)=4 then "April"
    when month(Date_transaction)=5 then "May"
    when month(Date_transaction)=6 then "June"
    when month(Date_transaction)=7 then "July"
    when month(Date_transaction)=8 then "August"
    when month(Date_transaction)=9 then "September"
    when month(Date_transaction)=10 then "October"
    when month(Date_transaction)=11 then "November"
    else "December" 
end as Month ,concat("$",round(sum(ticket.price),2)) as "Total Ticket Sales", concat(round(sum(ticket.price)/(sum(ticket.price)+sum(items.price*quantity))*100,2),"%") as "Percentage of total revenue from ticket sales", concat("$",round(sum(items.price*quantity),2)) as "Total Facility Sales", concat(round(sum(items.price*quantity)/(sum(ticket.price)+sum(items.price*quantity))*100,2),"%") as "Percentage of total revenue from facility sales", concat("$",round(sum(ticket.price)+sum(items.price*quantity),2)) as "Total Revenue"
from ticket, items, purchases
where items.ItemID=purchases.ItemID
group by Year, Month
order by "Total Revenue";


/*------------------------------------------------------------*/
/* Query 4 - Corresponds to section 6.4 of the written report */
/*------------------------------------------------------------*/

/*Goal: See if the location of the facility leads to more revenue*/
SELECT Rideproximity, Facility_type, concat("$",round(sum(quantity*price),2)) TotalRevenue
FROM facilityrideproximity, items, purchases
where facilityrideproximity.facility_id=items.facility_id and items.ItemID=purchases.ItemID
group by Rideproximity,Facility_type
order by sum(quantity*price) desc;


/*------------------------------------------------------------*/
/* Query 5 - Corresponds to section 6.5 of the written report */
/*------------------------------------------------------------*/

/*Goal: See the top 10 customers that spend the most at facilities and reward them with discounts for customer loyalty*/
select concat(first_name, " ", last_name) as Name, concat("$",round(sum(purchases.quantity*items.price),2)) as FacilitySpend
from customer, ticket, items, purchases
where items.ItemID=purchases.ItemID and customer.C_ID=ticket.C_ID and ticket.TICKET_ID=purchases.TICKET_ID
group by purchases.TICKET_ID
order by sum(purchases.quantity*items.price) desc limit 10;



/*------------------------------------------------------------*/
/* Query 6 - Corresponds to section 6.6 of the written report */
/*------------------------------------------------------------*/

/*Goal: See if temperature influences revenue made at facilities.*/
/* Step 1 - Create a view table with the "temperature feeling" based on the average temperature*/
create view tempfeeling as
select idWeatherDate, avg_temperature, total_daylightHR,
case
	when avg_temperature<=0 then "Cold"
    when avg_temperature<=10 then "Chilly"
    when avg_temperature<=20 then "Comfortable"
    else "Hot" 
end as temp_feeling
from weather;

/* Step 2 - See which "temperature feeling" makes the most revenue from facilities*/
select temp_feeling, concat("$",round(sum(purchases.quantity*items.price),2)) as "Total Revenue"
from tempfeeling, facility_tickets, ticket, purchases, items
where tempfeeling.idWeatherDate=facility_tickets.idWeatherDate and facility_tickets.TICKET_ID=ticket.TICKET_ID and ticket.TICKET_ID=purchases.TICKET_ID and items.ItemID=purchases.ItemID
group by temp_feeling
order by sum(purchases.quantity*items.price) desc;








